import React, { Component } from "react";
import PropTypes from "prop-types";

const Groomer = ({ Component }) => {
  return (
    <>
      <Component />
    </>
  );
};

Groomer.PropTypes = {
  Component: PropTypes.elementType.isRequired,
};

export default Groomer;
